DROP TABLE IF EXISTS movies;
DROP TABLE IF EXISTS genres;
DROP TABLE IF EXISTS movies_genres;
DROP TABLE IF EXISTS ratings;
DROP TABLE IF EXISTS tags;
DROP TABLE IF EXISTS users;
DROP TABLE IF EXISTS occupations;
DROP INDEX IF EXISTS user_last_name_idx;
DROP INDEX IF EXISTS movies_title_idx;
DROP INDEX IF EXISTS movies_year_idx;


CREATE TABLE movies(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    title TEXT NOT NULL,
    year INTEGER
);

CREATE TABLE genres(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    genre  TEXT NOT NULL
);

CREATE TABLE movies_genres(
    movie_id INTEGER NOT NULL,
    genre_id INTEGER NOT NULL,
    CONSTRAINT id PRIMARY KEY (movie_id,genre_id),
    FOREIGN KEY (movie_id) REFERENCES movies(id) ON DELETE CASCADE,
    FOREIGN KEY (genre_id) REFERENCES genres(id)
);

CREATE TABLE occupations(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    occupation TEXT NOT NULL UNIQUE
);

CREATE TABLE users(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    first_name TEXT NOT NULL,
    last_name TEXT NOT NULL,
    email TEXT NOT NULL UNIQUE,
    gender TEXT NOT NULL CHECK(gender = "male" OR gender = "female"),
    register_date TEXT NOT NULL DEFAULT (DATE('now')),
    occupation_id INTEGER,
    FOREIGN KEY (occupation_id) REFERENCES occupations('id')
);

CREATE TABLE ratings(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER NOT NULL,
    movie_id INTEGER NOT NULL,
    rating REAL NOT NULL CHECK (rating >= 0 AND rating <= 5),
    'timestamp' INTEGER NOT NULL DEFAULT(strftime('%s','now')),
    FOREIGN KEY (user_id) REFERENCES users(id),
    FOREIGN KEY (movie_id) REFERENCES movies(id) ON DELETE CASCADE
);

CREATE TABLE tags(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER NOT NULL,
    movie_id INTEGER NOT NULL,
    tag TEXT NOT NULL,
    'timestamp' INTEGER NOT NULL DEFAULT(strftime('%s','now')),
    FOREIGN KEY (user_id) REFERENCES users(id) ON DELETE CASCADE,
    FOREIGN KEY (movie_id) REFERENCES movies(id) ON DELETE RESTRICT
);









CREATE INDEX user_last_name_idx ON users(last_name);
CREATE INDEX movies_title_idx ON movies(title);
CREATE INDEX movies_year_idx ON movies(year) WHERE year IS NOT NULL;
PRAGMA FOREIGN_KEYS = ON;